import { useState, useEffect } from "react";

import api from "../../apis/api";

function Profile() {
  const [state, setState] = useState({
    name: "",
    email: "",
    password: "",
    document: "",
    address: {
      street: "",
      neighbourhood: "",
      city: "",
      district: "",
      postalCode: "",
      number: "",
    },
    birthDate: "",
    phoneNumber: "",
    role: "",
  });


  useEffect(() => {
    async function FetchProfile() {
      try {
        const response = await api.get("/profile");
            console.log("eu sou Response no Profile ---> ", response.data)
            setState({ ...response.data });

      } catch (err) {
        console.log(err);
      }
    }
    FetchProfile();
  }, []);

  return (
    <div>
          <div className="col-md-6">
    <label className="form-label">Name</label>
    <input type="text" className="form-control" id="inputEmail4" value={state.name}/>
  </div>
  <div className="col-md-6">
    <label className="form-label">Email</label>
    <input type="email" className="form-control" id="inputEmail4" value={state.email}/>
  </div>
  <div className="col-12">
    <label className="form-label">Document</label>
    <input type="text" className="form-control" id="inputAddress" placeholder="1234 Main St" value={state.document}/>
  </div>
  <div className="col-12">
    <label className="form-label">Address</label>
    <input type="text" className="form-control" id="inputAddress2" placeholder="Apartment, studio, or floor"/>
  </div>
  <div className="col-md-6">
    <label for="inputCity" className="form-label">City</label>
    <input type="text" className="form-control" id="inputCity"/>
  </div>
  <div className="col-md-4">
    <label className="form-label">State</label>
    <select id="inputState" className="form-select">
      <option selected>Choose...</option>
      <option>...</option>
    </select>
  </div>
  <div className="col-md-2">
    <label className="form-label">Zip</label>
    <input type="text" className="form-control" id="inputZip"/>
  </div>
    </div>
  );
}

export default Profile;
